def split_lowerstring(text: str) -> list:
    if not isinstance(text, str):
        raise TypeError("Input must be a string.")
    segments = []
    current_segment = ''
    for char in text:
        if char.islower():
            if current_segment:
                segments.append(current_segment)
                current_segment = ''
            segments.append(char)
        else:
            current_segment += char
    if current_segment:
        segments.append(current_segment)
    return segments

