def func(nums: List[List[int]], k: int) -> List[int]:
    if not any(nums):
        return []

    if k > sum(len(sublist) for sublist in nums):
        raise ValueError('k cannot be greater than the number of distinct integers')

    # Create a dictionary to store the frequency of each number
    freq: Dict[int, int] = {}
    for sublist in nums:
        for num in sublist:
            freq[num] = freq.get(num, 0) + 1

    # Use a heap to find the k most frequent numbers
    heap: List[Tuple[int, int]] = []
    for num, count in freq.items():
        if len(heap) < k:
            heapq.heappush(heap, (count, num))
        else:
            if count > heap[0][0]:
                heapq.heapreplace(heap, (count, num))

    # Return the k most frequent numbers
    return [num for _, num in heap]

def max_prime_factors(n: int) -> int:
    if n <= 0:
        raise ValueError('Input must be a positive integer.')
    i = 2
    while i * i <= n:
        if n % i:
            i += 1
        else:
            n //= i
    return n

