def get_gcd(numbers: List[Union[int, float]]) -> int:
    if not numbers:
        raise ValueError('Input list cannot be empty.')

    def gcd(a: Union[int, float], b: Union[int, float]) -> int:
        while b != 0:
            a, b = b, a % b
        return int(a)

    result = numbers[0]
    for num in numbers[1:]:
        result = gcd(result, num)

    return result

