def compute_last_digit(a: int, b: int) -> int:
    if a > b:
        raise ValueError('a should not be greater than b')
    if a == b:
        return 1

    # Calculate the last digit of the factorial of a divided by the factorial of b
    last_digit = 1
    for i in range(a + 1, b + 1):
        last_digit = (last_digit * i) % 10

    return last_digit

