def max_len_sub(arr: List[T], n: int) -> int:
    if not isinstance(arr, list) or not all(isinstance(x, int) for x in arr):
        raise TypeError("The first parameter must be a list of integers.")
    if not isinstance(n, int):
        raise TypeError("The second parameter must be an integer.")
    if not arr:
        return 0

    dp = [1] * n
    for i in range(1, n):
        for j in range(0, i):
            if arr[i] >= arr[j] and dp[i] < dp[j] + 1:
                dp[i] = dp[j] + 1
    return max(dp)
